VALUES ('3760272306107', 'Bœuf au Champignon Noir et Nouilles Sautées', 'Bœuf 30 %, sauce nuoc mam (extrait d\'ANCHOIS, sel, sucre), sauce HUÎTRE (eau, sucre, ,amidon de maïs modifié, extrait d\'HUÎTRE 4 %, exhausteur de goût E621, farine de BLÉ, colorant E150c), sauce SOJA (eau, SOJA, sel, sucre ,farine de BLÉ, extrait de champignons), sucre, fécule de pomme de terre), ŒUF, VIN, glutamate monosodique, jus d\'ananas, huile de tournesol, poivre, assaisonnement avec saveur de porc (sel, exhausteur de goût E621, sucre, poudre d\'épices (poudre d\'ail, poudre de poivre), extrait de viande de porc en poudre 3, 5 %(viande de porc, sucre, sauce SOJA), poudre de maltodextrine, saveur de porc 1,3 % (BLÉ, SOJA), oléine de palme, exhausteur de goût E635). Légumes : champignon noir, poireau, ail, oignon. Nouilles sautées 250 g : farine de BLÉ tendre 79,5 %, eau, sel, curcuma), carotte, ail, oignon, sauce SOJA (eau, graines de SOJA, BLÉ, sel), huile de tournesol, graines de SÉSAME.', 'https://static.openfoodfacts.org/images/products/376/027/230/6107/front_fr.6.400.jpg', '3.9', '0.5', '14.2', '5.3', '2.7', '8.1', '1.6', '0.62992125984252', '', '0');

